, CREME liquide, farine de BLE, amidon modifié de pomme de terre, levure chimique], FROMAGE de chèvre 10.6%, BLEU DE PAYS 7.9% (LAIT, sel, présure animale, ferment LACTIQUES et d\'affinage (Penicillium Roqueforti)), COMTE 7.9%, MIMOLETTE 6.6% (LAIT de vache, sel, ferments LACTIQUES, coagulant microbien, colorant : rocou), herbes de Provence.8 Moelleux aux Tomate-Mozzarella décongelés: Pâte à moelleux 66.6% [OEUFS, sauce béchamel (LAIT demi-écrémé, amidon de BLE, COMTE 1.1%, margarine*, sel, arôme naturel de poivre), CREME liquide, farine de BLE, amidon modifié de pomme de terre, levure chimique], tomates mi-séchées aux herbes 16.7% (tomates, huile de tournesol, sel, plantes aromatiques), MOZZARELLA 16.7% (LAIT de vache, sel, ferments LACTIQUES, coagulant microbien, correcteur d\'acidité : E330).8 Gougères aux fromages décongelées: Pâte 79.9% [eau, préparation pour pâte à choux (farine de BLE, CREME en poudre, jaune d’OEUF, blanc d’OEUF, chlorure de sodium, sucre, arôme, épice)], COMTE 14.9%, EMMENTAL 5%, dorure (jaune d’OEUF, LAIT demi-écrémé).Margarine : huiles et graisses végétales (palme, colza et tournesol), eau, sel, émulsifiants : E471, acidifiant : E330, arômes, colorant : E160a.', '', '20', '11', '16', '3', '2', '11', '1.5', '0.590551181102362', '', '0');

