VALUES ('3700009265659', 'Radiatori Pesto Rosso, 250g', 'pâtes alimentaires radiatori aux _oeufs_ cuites 51,1% (eau, semoule de _blé_ dur, oeufs), sauce pesto aux tomates mi-séchées 11,1% [tomates mi-séchées 3,8% (tomates, huile de tournesol, sel), _Parmigiano Reggiano_ 2,4%, huile d’olive vierge extra, ail 0,9%, basilic, pignons de pin grillés 0,9%], poivrons grillés 10,6%, huile de colza, courgettes grillées 4,8%, préparation culinaire à base de poivrons rouges 3,8% (poivrons rouges, huile de tournesol, jus de citron à base de concentré, sel, sucre, herbes de Provence, ail, poivre noir), eau, _fromage_ italien 2,8% (_lait_ de vache cru, sel, présure, conservateur : lysozyme (_oeuf_)), jus concentré de poivron rouge, plantes aromatiques, vinaigre balsamique (vinaigre de vin, moût de raisin concentré et cuit, colorant : caramel au sulfite d\'ammonium), vinaigre d’alcool, sel, _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre d\'alcool, sel), poivre blanc, colorant : extrait de paprika, amidon modifié de pomme de terre, épaississant : gomme xanthane.', 'https://static.openfoodfacts.org/images/products/370/000/926/5659/front_fr.9.400.jpg', '13', '2.1', '17', '3.2', '2', '6.6', '1', '0.393700787401575', '', '1');

