VALUES ('3700009268759', 'Salade & Duo de riz émietté de thon', '146,5 g de Duo de riz cuisinés (35,7%) : riz long étuvé cuit 22,1% (eau, riz long étuvé), riz sauvage cuit 5,3% (eau, riz sauvage noir), courgettes 5,3%, jeunes pousses d’épinard émincées, plantes aromatiques, huile de colza, poivrons rouges.  68,5 g d’Ingrédients savoureux (16,7%) : _thon_ 5,6% (_thon_ 5,3%, eau, sel), _œufs_ durs de poules élevées en plein air 5,4%, tomates cerise semi-déshydratées marinées 3,6% (tomates cerise semi-déshydratées, huile de tournesol, sel, plantes aromatiques), olives variété Kalamon dénoyautées 1,7% (olives, sel, vinaigre d\'alcool, huile de tournesol), tomates 0,1%, basilic. Traces éventuelles de soja.  100 g de Compote de pommes allégée en sucres* (24,4%) : pommes 23,6%, sucre, antioxydant : acide ascorbique. * 30% de sucres en moins qu\'une compote classique.  45 g de Salades mélangées (11%) : laitue, chicorée et roquette  25 g de Sauce au vinaigre balsamique (6,1%) : huile de colza, vinaigre balsamique 1,4% (vinaigre de vin, moût de raisins), huile d’olive vierge extra, _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre d’alcool, sel), sel, poivre noir.  25 g de Gâteau avec 9,6% de chocolat noir (6,1%) : sucre, œufs de poules élevées en plein air, farine de _blé_, _beurre_ pâtissier, huile de colza, sirop de glucose - fructose, stabilisants : sorbitols - glycérol, pâte de cacao, cacao en poudre, cacao maigre en poudre, sel, émulsifiant : lécithines (_soja_). Traces éventuelles de fruits à coque.', 'https://static.openfoodfacts.org/images/products/370/000/926/8759/front_fr.7.400.jpg', '7.8', '1.5', '16', '5.9', '1.6', '4', '0.3', '0.118110236220472', '', '1');

